import { FETCH_ALL_CUSTOMER } from "../actions/types";

const initialState = [];

export default function(state = initialState, action) {
  const { type, payload } = action;

  switch (type) {
    case FETCH_ALL_CUSTOMER:
      return [...state, payload];

    default:
      return state;
  }
}
